// 2. Sequential slideshow
int current_nasa_index = 0;

void displayNextNASAImage() {
  HTTPClient http;
  http.begin(nasa_ultimate_collection[current_nasa_index].url);
  
  int httpCode = http.GET();
  if (httpCode == HTTP_CODE_OK) {
    WiFiClient* stream = http.getStreamPtr();
    int contentLength = http.getSize();
    
    uint8_t* buffer = (uint8_t*)malloc(contentLength);
    if (buffer) {
      stream->readBytes(buffer, contentLength);
      
      tft.fillScreen(TFT_BLACK);
      TJpgDec.drawJpg(0, 0, buffer, contentLength);
      
      // Title and progress
      tft.setTextColor(TFT_WHITE, TFT_BLACK);
      tft.setTextSize(1);
      
      String title = String(nasa_ultimate_collection[current_nasa_index].title);
      if (title.length() > 45) title = title.substring(0, 42) + "...";
      
      int titleWidth = tft.textWidth(title);
      int titleX = (320 - titleWidth) / 2;
      if (titleX < 0) titleX = 5;
      
      tft.fillRect(0, 220, 320, 20, TFT_BLACK);
      tft.drawString(title, titleX, 225);
      
      tft.setTextColor(TFT_CYAN);
      String progress = String(current_nasa_index + 1) + "/" + String(NASA_TOTAL_IMAGES);
      tft.drawString(progress, 5, 5);
      
      free(buffer);
      
      Serial.println("Sequential: " + String(nasa_ultimate_collection[current_nasa_index].title));
    }
  }
  
  http.end();
  
  // Advance to next image
  current_nasa_index = (current_nasa_index + 1) % NASA_TOTAL_IMAGES;
}

// 3. Find image by partial title match
int findNASAImageByTitle(const char* searchTitle) {
  String search = String(searchTitle);
  search.toLowerCase();
  
  for (int i = 0; i < NASA_TOTAL_IMAGES; i++) {
    String title = String(nasa_ultimate_collection[i].title);
    title.toLowerCase();
    
    if (title.indexOf(search) >= 0) {
      return i;
    }
  }
  
  return -1; // Not found
}

// 4. Display specific image by index
void displayNASAImageByIndex(int index) {
  if (index < 0 || index >= NASA_TOTAL_IMAGES) {
    Serial.println("Invalid image index: " + String(index));
    return;
  }
  
  current_nasa_index = index;
  displayNextNASAImage();
}

// 5. Get random image from specific year
void displayRandomFrom2024() {
  // Adjust range based on your data
  int random2024 = random(200);  // Approximately first 200 images are 2024
  displayNASAImageByIndex(random2024);
}

void displayRandomFrom2025() {
  // Adjust range based on your data
  int random2025 = 200 + random(NASA_TOTAL_IMAGES - 200);  // Rest are 2025
  displayNASAImageByIndex(random2025);
}

